export default function PopupWithAuth({
  children,
  buttonText,
  onSubmit,

}) {
  return (
    <form className="popup__form popup__form_type_auth" name="login" onSubmit={onSubmit}>
      {children}
      <button
        className=

             "popup__button popup__button_type_login"


        type="submit"
      >
        {buttonText}
      </button>
    </form>
  );
}
